import React from "react";
import {Helmet} from "react-helmet";
import "./SignInForm.css";

const SignInForm = () => {
    return (
        <div id="signin-form">
            <Helmet>
                <title>Sign In</title>
                <body style={ {
                    backgroundColor: '#060f1f',
                    background: 'linear-gradient(0.25turn, #010126, #313f64, #020128)'}
                    } />               
            </Helmet>
            <h2>sad</h2>

        </div>
    )
}

export default SignInForm;
